metadata.description:
A spatial exploration through the canvas, where the piece is formed by lines, colors and movements.

press 'S' in live mode to save in PNG.

@gpitombo, April 2022

Everything that they have revealed thus far is but the tip of the iceberg and is consistent with everything we do know.

Features:
1) Hue (12);
2) Iceberg Width (3);
3) Hummock Height (3);
4) Bummock Height (3).

